        <div id="align-top"></div>
        <div class="row">
          <div className="col-lg-12 col-sm-12 mb-12">
            <h1 className="titleFullView text-center">
              {this.props.titleFullView}
            </h1>
          </div>
          <div class="row">
            <div className="col-lg-12 col-sm-12 mb-12">
              <div
                className="fb-like"
                data-href={
                  "http://localhost:3000/" + this.props.partURL_plugin_fb
                }
                data-layout="button_count"
                data-action="like"
                data-size="large"
                data-share="true"
              ></div>
            </div>
          </div>
        </div>

        <div className="row ">
            <img className="imgFullView text-justify text-center " src={this.props.imgFullView}></img>
          <div className="col-lg-12 col-sm-12 mb-12  ">
            <p className="contentFullView">{this.props.contentFullView}</p>
          </div>
        </div>
      </div>
    );
  }
}

export default NewsFullView;
